import React from "react";
import Footer from "../../components/Footer/Footer";
import Topbar from "../../components/Topbar/Topbar";

function Homebody(){
    return (
        <div class="body1">
            <img src="/src/images/sitting.png"></img>
        </div>
        
        
        
    );
}

function Home(){
    return(
        <>
        <Topbar />
        <Homebody />
        <Footer />
        </>

    );
}
export default Home;
